import React from "react";
import useNavigate from "react-router-dom";

const AllRecepies = (props) => {
  c
  return (
    <div className="card-container">
      {props.data &&
        props.data.map((e, i) => {
          return (
            <div
              class="card-client"
              onClick={() => {
                props.one(e);
                navigate('/allproject/oneproject')

              }}
            >
              <div class="user-picture">
                <img
                  src={e.sreenshotLink}
                  alt={e.name}
                  onClick={() => {
                    return <a href={e.viewlink}></a>;
                  }}
                />
              </div>
              <p class="name-client"> {e.name}</p>
              <p>owner : {e.owner}</p>
              <a href={e.viewlink}> Open the website</a>
            </div>
          );
        })}
    </div>
  );
};

export default AllRecepies;
